INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (2, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 24, 24001, 401, "2020/07/31 12:00:00", 10046, 102301, 0.0, "2030/12/17 14:59:59", "アヤネ", 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1, 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2, 24, 24002, 402, "2020/07/31 12:00:00", 10046, 102301, 0.0, "2030/12/17 14:59:59", "アヤネ", 2.21);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (2, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 24, 24003, 403, "2020/07/31 12:00:00", 10046, 102301, 0.0, "2030/12/17 14:59:59", "アヤネ", 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (2, 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1, 24, 24004, 701, "2020/07/31 12:00:00", 10046, 192201, 0.0, "2030/12/17 14:59:59", "アサヒ", 1.99);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1, 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2, 24, 24005, 702, "2020/07/31 12:00:00", 10046, 192201, 0.0, "2030/12/17 14:59:59", "アサヒ", 2.21);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (2, 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 1, 24, 24006, 703, "2020/07/31 12:00:00", 10046, 192201, 0.0, "2030/12/17 14:59:59", "アサヒ", 3.33);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (2, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 24, 24007, 801, "2020/07/31 12:00:00", 10046, 192301, 0.0, "2030/12/17 14:59:59", "部員３", 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1, 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2, 24, 24008, 802, "2020/07/31 12:00:00", 10046, 192301, 0.0, "2030/12/17 14:59:59", "部員３", 2.68);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (2, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 24, 24009, 803, "2020/07/31 12:00:00", 10046, 192301, 0.0, "2030/12/17 14:59:59", "部員３", 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1, 0.0, "やった！", 1, 24, 24010, 501, "2020/07/31 12:00:00", 10046, 192501, 0.0, "2030/12/17 14:59:59", "", 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1, 0.0, "勝ったよ！", 1, 24, 24011, 502, "2020/07/31 12:00:00", 10046, 192501, 0.0, "2030/12/17 14:59:59", "", 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1, 0.0, "いい調子！", 1, 24, 24012, 503, "2020/07/31 12:00:00", 10046, 192501, 0.0, "2030/12/17 14:59:59", "", 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (6, 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 2, 24, 24013, 111, "2020/07/31 12:00:00", 10046, 113501, 0.0, "2030/12/17 14:59:59", "ミサト", 5.33);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1, 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 2, 24, 24014, 112, "2020/07/31 12:00:00", 10046, 113501, 0.0, "2030/12/17 14:59:59", "ミサト", 6.85);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1, 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 2, 24, 24015, 113, "2020/07/31 12:00:00", 10046, 113501, 0.0, "2030/12/17 14:59:59", "ミサト", 3.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1, 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 2, 24, 24016, 611, "2020/07/31 12:00:00", 10046, 192401, 0.0, "2030/12/17 14:59:59", "ダイチ", 6.11);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1, 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 2, 24, 24017, 612, "2020/07/31 12:00:00", 10046, 192401, 0.0, "2030/12/17 14:59:59", "ダイチ", 6.75);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (2, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 24, 24018, 613, "2020/07/31 12:00:00", 10046, 192401, 0.0, "2030/12/17 14:59:59", "ダイチ", 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (2, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 1, 24, 24019, 211, "2020/07/31 12:00:00", 10046, 113401, 0.0, "2030/12/17 14:59:59", "ハツネ", 4.52);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (2, 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 1, 24, 24020, 212, "2020/07/31 12:00:00", 10046, 113401, 0.0, "2030/12/17 14:59:59", "ハツネ", 3.89);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1, 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 2, 24, 24021, 213, "2020/07/31 12:00:00", 10046, 113401, 0.0, "2030/12/17 14:59:59", "ハツネ", 13.49);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1, 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 2, 24, 24022, 311, "2020/07/31 12:00:00", 10046, 106501, 0.0, "2030/12/17 14:59:59", "カヤ", 3.17);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1, 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 2, 24, 24023, 312, "2020/07/31 12:00:00", 10046, 106501, 0.0, "2030/12/17 14:59:59", "カヤ", 4.42);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (6, 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 1, 24, 24024, 313, "2020/07/31 12:00:00", 10046, 106501, 0.0, "2030/12/17 14:59:59", "カヤ", 2.89);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (4, 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3, 24, 24025, 421, "2020/07/31 12:00:00", 10046, 102301, 0.0, "2030/12/17 14:59:59", "アヤネ", 3.71);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (2, 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 1, 24, 24026, 721, "2020/07/31 12:00:00", 10046, 192201, 0.0, "2030/12/17 14:59:59", "アサヒ", 5.1);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1, 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 3, 24, 24027, 821, "2020/07/31 12:00:00", 10046, 192301, 0.0, "2030/12/17 14:59:59", "部員３", 4.34);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1, 0.0, "いい勝負だったよ\nまたやろうね", 1, 24, 24028, 521, "2020/07/31 12:00:00", 10046, 192501, 0.0, "2030/12/17 14:59:59", "", 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1, 0.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 2, 24, 24029, 101, "2020/07/31 12:00:00", 10046, 113501, -360.0, "2030/12/17 14:59:59", "ミサト", 5.62);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1, 0.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 2, 24, 24030, 102, "2020/07/31 12:00:00", 10046, 113501, -360.0, "2030/12/17 14:59:59", "ミサト", 9.58);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (2, 0.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, 24, 24031, 103, "2020/07/31 12:00:00", 10046, 113501, -360.0, "2030/12/17 14:59:59", "ミサト", 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (2, 0.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 1, 24, 24032, 104, "2020/07/31 12:00:00", 10046, 113501, -360.0, "2030/12/17 14:59:59", "ミサト", 9.13);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1, 0.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 2, 24, 24033, 105, "2020/07/31 12:00:00", 10046, 113501, -360.0, "2030/12/17 14:59:59", "ミサト", 8.27);
